import { combineReducers } from "redux";
import model from "./model/Reducer";
import systems from "./systems/Reducer";
import flows from "./flows/Reducer";
import organisation from "./organisation/Reducer";

export default combineReducers({
  model,
  systems,
  flows,
  organisation
});
